import Navbar from "./Navbar";
import Home from "./Home";
import { Route,ROU } from "react-router-dom";
import Users from "./Users";


function Main() {
  return (
    <>
      <Navbar/>
      <Home/>

    <Routes>
      <Route path="./Users"element={<Users/>}/>
    </Routes>
     
    </>
  );
}

export default Main;
